import React from 'react';
import Data from './Data'
import Card from './Cards'

const Netflix = () => {
    return(
        <>
        <Card
          key= {Data[1].id}
          imgsrc={Data[1].imgsrc}
          sname={Data[1].sname}
          title={Data[1].title}
          link={Data[1].link}
        />
        <Card
          key= {Data[1].id}
          imgsrc={Data[1].imgsrc}
          sname={Data[1].sname}
          title={Data[1].title}
          link={Data[1].link}
        />
        </>
      )
}

export default Netflix;
